const INITIAL_STATE = {
    data:[]
  }
  
  export default function setDateReducer(state = INITIAL_STATE, action) {
    console.log(action.payload);
      switch (action.type) {
        case "DATE_RANGE":
          return {
            ...state,
            data: action.payload
          };
        default:
          return state;
      }
    }
